import React from 'react'
import Card from '../Card/Card'
const CardList = ({ServiceList}) => {
	return(
		<div>
			{
				ServiceList.map((service, i) => {
					return (<Card 
							key={i}
							id={service.id}
							title={service.title}
							image={service.image}
							description={service.description}
						/>
					)
				})
			}
		</div>
	);
}

export default CardList;
